import React from "react";
import Nav from "./components/Nav";
import Router from "./components/Router";
// import Photos from "./components/Photos";
import Footer from "./components/Footer";
import "./App.scss";

function App() {
  return (
    <div className='App'>
      <Nav />
      <Router />
      <p>Beinvenidos mi gente!</p>
      {/* <Photos /> */}
      <Footer />
    </div>
  );
}
export default App;
